import React from 'react';
import logo from './logo.svg';
import './App.css';
import axios from 'axios';

function App() {
  const url = `https://api.openweathermap.org/data/2.5/weather?q=London&unit=imperialappid=381e045e4c2c96594b3f565f73e49cbb`
  axios.get(url).then((resp)=>{
    console.log(resp.data)
  })
  return (
    <div className="App">
      <h1> Sanity Check</h1>
    </div>
  );
}

export default App;
